import React from 'react';
import './App.css';
import Header from './components/Header';
import Navbar from './components/Navbar';


const App = () => {
  return (
    <div className="app-wrapper">
      <Header/>
      <Navbar/>

      <div className="content">
        <div><img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRJSh8l38jeaEMhgiGeDlrPzWFqSIEezfE-VU4pfdatk9KdZMvO"></img></div>
        <div> Avatar and content</div>
        <div>My post</div>
        <div>New post</div>

      </div>

    </div>
  )

}



export default App;
